const BookingDetails = ({ booking }) => {
    if (!booking) return <p>Tidak ada pemesanan aktif.</p>;
  
    return (
      <div>
        <h2>Rincian Pemesanan</h2>
        <p>Nama: {booking.name}</p>
        <p>Nomor Kendaraan: {booking.vehicle}</p>
        <p>Durasi: {booking.duration} jam</p>
      </div>
    );
  };
  
  export default BookingDetails;
